import "./App.css";
import { BrowserRouter, Routes, Route ,Link,Navigate} from "react-router-dom";
import Indexinter from "./components/Indexinter"
function App() {

  return (
    <Router>
      <div className="App">
        <Switch>
          <Route exact path="/default-route"><Home/></Route>
          <Route path="/add">
            <TestIndex/>
          </Route>
          <Route path="/list">
            <Todolist/>
          </Route>
          <Route path="/edit/:id">
            <Edit/>
          </Route>
          <Redirect to="/default-route" />
        </Switch>

      </div>
    </Router>
  );
}

export default App;
